(()=>{const n=document.querySelector(".run_string"),t=document.querySelectorAll(".run_string_item");let e=0;t.forEach((n=>{e+=n.getBoundingClientRect().width}));let r=Math.ceil(n.offsetWidth/e)+1;for(let e=0;e<r;e++)t.forEach((t=>{const e=t.cloneNode(!0);n.appendChild(e)}));const i=e/50;n.style.animation=`runStringAnimation ${i}s linear infinite`;const o=document.createElement("style");o.innerHTML=`\n@keyframes runStringAnimation {\n  0% {\n    transform: translateX(0);\n  }\n  100% {\n    transform: translateX(-${e}px);\n  }\n}\n`,document.head.appendChild(o)})();